import React from 'react';
import { StyledHeader, Wrapper, StyledLogo, StyledNav, StyledSearch } from './styles';

const Header: React.FC = () => {
  return (
    <StyledHeader>
      <Wrapper>
        <h1 className='visually-hidden'>Интернет-магазин "Девайс"</h1>
        <StyledLogo />
        <StyledSearch placeholder='Поиск по сайту'/>
        <StyledNav width='100%' asymmetric />
      </Wrapper>
    </StyledHeader>
  );
};

export default Header;
